import React from "react";
import { useSelector } from "react-redux";

function NewShowUser() {
  const users = useSelector((state) => state.users.value);
  return (
    <div>
      {users.map((x) => (
        <div>
          <img src={x.userimage} alt="" />
          <div>{x.username}</div>
          <div>{x.usercity}</div>
        </div>
      ))}

      <div></div>
    </div>
  );
}

export default NewShowUser;
